            /// transactions/mint_v2.cdc

import FungibleToken from 0xf233dcee88fe0abe
import FungibleTokenMetadataViews from 0xf233dcee88fe0abe
import NonFungibleToken from 0x1d7e57aa55817448
import MetadataViews from 0x1d7e57aa55817448

import JOSHIN from 0x82ed1b9cba5bb1b3




transaction(
	amount: UFix64,
	name: String,
	artist: String,
	artistAddress: Address,
	description: String,
	royalty: UFix64,
	typeID: String
) {

    /// Reference to the Token Minter Resource object
    let tokenAdmin: &JOSHIN.Administrator
    let tokenReceiver: &{FungibleToken.Receiver}


    prepare(
      minter: auth(BorrowValue) &Account,
      receiver: auth(BorrowValue, IssueStorageCapabilityController, PublishCapability, SaveValue, UnpublishCapability) &Account
    ) {

      let vaultData = JOSHIN.resolveContractView(resourceType: nil, viewType: Type<FungibleTokenMetadataViews.FTVaultData>()) as! FungibleTokenMetadataViews.FTVaultData?
            ?? panic("ViewResolver does not resolve FTVaultData view")

      // enable receiver token
      if receiver.storage.borrow<&JOSHIN.Vault>(from: vaultData.storagePath) == nil {
        let vault <- JOSHIN.createEmptyVault(vaultType: Type<@JOSHIN.Vault>())

        // Create a new JOSHIN Vault and put it in storage
        receiver.storage.save(<-vault, to: vaultData.storagePath)

        // Create a public capability to the Vault that exposes the Vault interfaces
        let vaultCap = receiver.capabilities.storage.issue<&JOSHIN.Vault>(vaultData.storagePath)
        receiver.capabilities.publish(vaultCap, at: vaultData.metadataPath)

        // Create a public Capability to the Vault's Receiver functionality
        let receiverCap = receiver.capabilities.storage.issue<&JOSHIN.Vault>(vaultData.storagePath)
        receiver.capabilities.publish(receiverCap, at: vaultData.receiverPath)
      }

      self.tokenAdmin = minter.storage.borrow<&JOSHIN.Administrator>(from: JOSHIN.AdminStoragePath)
          ?? panic("Signer is not the token admin")

      self.tokenReceiver = getAccount(receiver.address).capabilities.borrow<&{FungibleToken.Receiver}>(vaultData.receiverPath)
          ?? panic("Could not borrow receiver reference to the Vault")


    }

    execute {
        if amount > UFix64(0) {
          // Create mint tokens
			    let tokenMinter <- self.tokenAdmin.createNewMinter()

			    let mintedVault <- tokenMinter.mintTokens(amount: amount)

          // Deposit them to the receiever
          self.tokenReceiver.deposit(from: <-mintedVault)

          destroy tokenMinter
        }

    }
}
